import { useHttpClient } from "../Hooks/Http-Hook"
import "./Course.css"
import CourseList from "./CourseList";
const Course=()=>{
    
    //const {isLoading,error,sendRequest,clearError}=useHttpClient();
    let course;
    // try{
    //     course=await sendRequest(
    //         `https://web-mini.herokuapp.com/course`,
    //         'GET',
    //         {'Content-Type':'application/json'}
    //         );
    // }
    // catch(err){
    //     console.log("course error\n"+err);
    // }
    let type;
     course=[
        {
            title:"course1",
            type:"Aptitude",
            link:"source video 1"
        },
        {
            title:"course 2",
            type:"techical",
            link:"source video 2"
        },
        {
            title:"course 3",
            type:"techical",
            link:"source video 2"   
        }
     ]
    return(
        <div style={{paddingTop:"5%"}}>
            <h1>COURSES YOU WANT</h1>
            <div class="btn-group">
            <button onClick={()=>{ course=[
        {
            title:"courseA1",
            type:"Aptitude",
            link:"source video 1"
        },
        {
            title:"course A2",
            type:"techical",
            link:"source video 2"
        },
        {
            title:"course A3",
            type:"techical",
            link:"source video 2"   
        }
     ]}}>Aptitude series</button>
            <button onClick={()=>{type="T"}}>Technical series</button>
            <button onClick={()=>{type="H"}}>HR series</button>
            </div>
            
            <CourseList items={course} type={type}/>
        </div>
    )
}

export default Course;
